INSERT INTO `details_en` VALUES ('BOCCF-cf','The artwork','Frame decorated with silkworm cocoons','Unknown','','','The process of cultivating silkworms and producing silk was primarily an industrial process, used to make durable linens and clothing but was also approached in villages as a type of folk art. Using cut-up empty silk cocoons, a by-product of silk spinning, Cypriots would adorn velvet, satin or other cloths with shapes resembling flowers, birds and other decorative patterns. Often used as picture frames, these silk cocoon collages highlight how natural materials can be used in different processes and approached from different perspectives.  Since the 1960’s there has been a decline in silkworm breeding, a craft that now has almost disappeared.',NULL,NULL,NULL),('BOCCF-cf-decoration','Decoration','Frame decorated with silkworm cocoons','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cf/details/decoration/image/decoration.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cf/details/decoration/icon/decoration.jpg','Using cut-up empty silk cocoons, a by-product of silk spinning, Cypriots would adorn velvet, satin or other cloths. It is likely that silk cocoon embroidery was at first a way to utilize cocoons unsuitable for silk production. The most common themes are patterns of flowers, birds and a variety of other adornments, most commonly centered around elements found in nature.\n',NULL,NULL,'BOCCF-cf'),('BOCCF-cf-photo','Photo','Frame decorated with silkworm cocoons','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cf/details/photo/image/photo.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cf/details/photo/icon/photo.jpg','Often used as picture frames, these silk cocoon collages highlight how natural materials can be used in different processes and approached from different perspectives. The process of cultivating silkworms and producing silk was primarily an industrial process, used to make durable linens and clothing but was also approached in villages as a type of folk art. Since the 1960’s there has been a decline in silkworm breeding, a craft that now has almost disappeared.',NULL,NULL,'BOCCF-cf'),('BOCCF-cm','Cyprus Map','Cyprus map','Nicolò Nelli','','','Issued in 1570 by Nicolò Neli, the year the Ottoman attack on Cyprus had begun, this map shows the island surrounded by vessels of the Venetian fleet oriented towards the east, facing the direction of the Ottoman threat. The military situation in the Eastern Mediterranean encouraged the production of large numbers of maps to illustrate the islands and possible threats of war. Other than geographical depictions of land, maps also illustrate how knowledge surrounding conflict is produced, question who is producing it, and show how this knowledge is used to avoid, contain or overcome conflict.',NULL,NULL,NULL),('BOCCF-cm-island','Island','Cyprus map','Nicolò Nelli','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/island/image/island.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/island/icon/island.jpg','Due to its geo-political strategic position and rich agricultural production, Cyprus was reduced to a trading piece for larger empires ultimately greatly suffering the consequences of economic exploitation and violent conflict, the effects of which are still felt today.',NULL,NULL,'BOCCF-cm'),('BOCCF-cm-mapmaker','Map maker','Cyprus map','Nicolò Nelli','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/mapmaker/image/mapmaker.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/mapmaker/icon/mapmaker.jpg','For centuries, maps have been important tools in military logistics as well as critical means for understanding conflicts. The map depicts the island of Cyprus, whose shape is not based on any serious survey, and unlike most maps of Cyprus, it is not oriented towards the north, but the east. In an effort to depict the conflict, Nelli strategically places Ottoman warships coming from the East, and Venetian ships trying to defend their territory.”',NULL,NULL,'BOCCF-cm'),('BOCCF-cm-ottoman-fleet','Ottoman fleet','Cyprus map','Nicolò Nelli','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/ottoman-fleet/image/ottoman-fleet.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/ottoman-fleet/icon/ottoman-fleet.jpg','After years of tension with the Ottoman Empire resulting in frequent raids on the island,  during which Cypriots were taken captive and sold into slavery, the Ottomans invaded Cyprus with overwhelming force in 1570. The invasion resulted in much bloodshed and resulted in the islands occupation until 1878.',NULL,'','BOCCF-cm'),('BOCCF-cm-venetian-fleet','Venetian Fleet','Cyprus Map','Nicolò Nelli','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/venetian-fleet/image/venetian-fleet.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-cm/details/venetian-fleet/icon/venetian-fleet.jpg','Looking to expand their sphere of influence and control over the Eastern Mediterranean, the Venetian Republic annexed Cyprus in 1489. Cyprus strategic location near the Levant coast was of much interest to the Mediterranean world. The Venetians highly valued the island\'s location for trade and exploited the feudal system using the local serfs for costless labor.',NULL,NULL,'BOCCF-cm'),('BOCCF-tb','The artwork','Temple boy','Unknown','','','Linked to hierarchies in patriarchal societies, objects such as these highlight stark differences between genders when it comes to social expectations, status and discrimination on the basis of gender.',NULL,NULL,NULL),('BOCCF-tb-ball','Ball','Temple boy','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-tb/details/ball/image/ball.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-tb/details/ball/icon/ball.jpg','In his right hand he holds a round object, while his left hand rests on another.',NULL,NULL,'BOCCF-tb'),('BOCCF-tb-bracelet','Bracelet','Temple boy','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-tb/details/bracelet/image/bracelet.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-tb/details/bracelet/icon/bracelet.jpg','The round-faced boy sits on an irregular plinth and is adorned with bracelets round both wrists.',NULL,NULL,'BOCCF-tb'),('BOCCF-tb-head','Head','Temple boy','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-tb/details/head/image/head.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/BOCCF-tb/details/head/icon/head.jpg','His hair is grooved and his lips, parts of his dress and base are painted red. ',NULL,NULL,'BOCCF-tb'),('Graz-ch','The artwork','Trade Guild Chest','Unknown','','','The rich decor of the Gingerbread Bakers’s Chest bears wit ness to the wealth of the guild members. The chest was used  for storing important documents such as the Crafts Code,  which was established by Ferdinand II in 1597. The ginger bread bakers worked with and traded in honey. They made  candles of beeswax and enjoyed a special right to brew  mead, which secured them a profitable additional income.',NULL,NULL,NULL),('GRAZ-ch-bottom-drawer','Bottom drawer','Trade Guild Chest','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/bottom-drawer/image/bottom-drawer.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/bottom-drawer/icon/bottom-drawer.jpg','Guild chests were usually secured by several locks. The chest was intended to be opened collectively and only with the keys of chosen representatives, since the contents of the chests were valuable. The most\nimportant documents of each guild as well as the guild treasury were kept inside. The treasury was partly funded by fines for breaches of the rules. For example, a member had to pay a penalty if he divulged what had been discussed at meetings, which were held in front of an open guild chest.',NULL,NULL,'Graz-ch'),('GRAZ-ch-castle-view','Castle view','Trade Guild Chest','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/castle-view/image/castle-view.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/castle-view/icon/castle-view.jpg','Crafts played an important role from the Middle Ages on, especially in cities and market towns. Urban politics was dominated by trade and craft affairs. Many cities in northern, western and central Europe have a rich history of crafts, including Graz. Traces of medieval Graz can still be seen today, especially in the inner city. Here there was a range of skilled trades that included butchers, bakers, shoemakers, tailors, barbers and barber-surgeons, blacksmiths, millers, master builders, masons, carpenters and glaziers.',NULL,NULL,'Graz-ch'),('GRAZ-ch-honeybees','Bee hive','Trade Guild Chest','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/hive/image/hive.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/hive/image/hive.jpg','The beehive symbolises honey – the most important resource for the gingerbread bakers’ craft. Honey was a key ingredient of the gingerbread baked in the Middle Ages. Before sugar was industrially produced from sugar cane, honey was essential for sweetening food. In the 19th century, sugar bakers gradually replaced the craft of the gingerbread makers by using cheap beet sugar, among other things.\n',NULL,NULL,'Graz-ch'),('GRAZ-ch-lock','Lock','Trade Guild Chest','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/lock/image/lock.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-ch/details/lock/icon/lock.jpg','Guild chests were usually secured by several locks. The chest was intended to be opened collectively and only with the keys of chosen representatives, since the contents of the chests were valuable. The most\nimportant documents of each guild as well as the guild treasury were kept inside. The treasury was partly funded by fines for breaches of the rules. For example, a member had to pay a penalty if he divulged what had been discussed at meetings, which were held in front of an open guild chest.',NULL,NULL,'Graz-ch'),('GRAZ-cr','Cherry Rage','Cherry rage','Axl Leskoschek','','','Riot in the Years of Famine \nThe food supply of the families during and after the First World War was especially taken care of by women. Even after the end  \nof the war, the people starved. In the morning of 7 June 1920, the situation got out of control due to too high prices for fruit  \non the Kaiser-Josef-Markt in Graz. Initially, women claimed for cheaper food, the protests quickly escalated, and were explicit \nly directed at Jewish shops in the Annenstraße. In the evening, the security forces fired gunshots. Played down in retrospect  \nas “Kirschenrummel“ (Cherry Rage), 13 people were killed when the revolt was quelled.',NULL,NULL,NULL),('GRAZ-cr-people','Axl Leskoschek','Cherry rage','Axl Leskoschek','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-cr/details/people/image/people.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-cr/details/people/icon/people.jpg','Axl Leskoschek achieved greater recognition as an artist, children’s book illustrator and academy professor in Brazil than in his native Austria. In 1919, the law graduate had turned to art in his home city of Graz, aligning himself with the second generation of Expressionists. Because of his closeness to the Social Democrats and later Communism, he set himself in open opposition to Austrofascism and National Socialism. After the Anschluss in 1938 he fled into exile, finally experiencing his heyday as an artist in Brazil from 1941 to 1948. Following his return, his political convictions meant that he was unable to continue his successful career.',NULL,NULL,'GRAZ-cr'),('GRAZ-cr-police','Contrasts','Cherry rage','Axl Leskoschek','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-cr/details/policemen/image/policemen.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-cr/details/policemen/icon/policemen.jpg','The expressive, clear language of form and the strong contrasts produced by the woodcut technique are immediately eye-catching. Woodcut is considered to be the oldest graphic printing method. With the invention of letterpress printing, this relief printing technique was primarily used in book illustration. The artist Albrecht Dürer took the prints to a new level. Also famous are Japanese coloured woodblock prints, which inspired the Expressionists Munch, Gauguin and the artists of the “Die Brücke” group. During the 20th century in the interwar period, this printing process was associated with the “common people” and so seen as the medium of more “progressive” or left-wing artists, but was ultimately also used as a propaganda medium for various different political directions.',NULL,NULL,'GRAZ-cr'),('GRAZ-cr-woman','Retrospective','Cherry rage','Axl Leskoschek','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-cr/details/woman/image/woman.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-cr/details/woman/icon/woman.jpg','In his scene depicting the “Cherry Rage” riot, Axl Leskoschek shows people from all walks of life standing shoulder to shoulder, defying the law enforcers. A striking element is that we can tell them apart by their headgear. As well as women, he also has former officers, workers and students appearing as participants in the protest. Although it is not absolutely certain that all of these groups were involved, in Leskoschek’s 1955 work they become part of the situation that escalated in June 1920. In addition, he includes the “Cherry Rage 1920” in the list of significant events in his cycle on contemporary history. The protest in Graz was just one of many demonstrations calling for affordable food and goods taking place at that time both in Austria and abroad.',NULL,NULL,'GRAZ-cr'),('GRAZ-sp','The artwork','Self portrait','Ida Sofia Maly','','','Ida Maly, who lived an unconventional and emancipated life as an artist, depicted herself as a garçonne, a women of  \nboyish appearance, in her self portrait. The breaking with stereotyped roles defined by society and the suspension of  \ntypically female and male gender identity were characteris tic features of her works. In 1941, she was murdered in the  \nframe of the Nazi euthanasia programme in an extermination centre near Linz. ',NULL,NULL,NULL),('GRAZ-sp-eyes','Eyes','Self portrait','Ida Sofia Maly','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-sp/details/eyes/image/eyes.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-sp/details/eyes/image/eyes.jpg','The effects of the First World War were also felt by artists of the time. The political instability of the Weimar Republic, inflation and unemployment extended throughout the various social classes and caused misery.\nLiving and surviving as an artist in the 1920s was a challenge. In order to escape financial hardship, you had to be on the constant lookout for potential clients and patrons. A lot of effort went into courting and charming the few people who could commission and pay for a work of art.',NULL,NULL,'GRAZ-sp'),('GRAZ-sp-hair','Hair','Self portrait','Ida Sofia Maly','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-sp/details/hair/image/hair.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-sp/details/hair/icon/hair.jpg','Ida Sofia Maly’s work cannot be pinned down to a particular style. She moved between elements of different trends and art movements. As a constant seeker, and due to her precarious living conditions, she often had to adapt her artistic expression in order to find clients. She devoted herself to Expressionism, tried out abstract design, used aspects of Art Nouveau and Art Deco and became familiar with New Objectivity. Her later works show shifted perspectives, fantastical beings with oversized heads and robotic figures.\nHer oeuvre encompasses paintings, copies of old masters, drawings and text-image combinations. However, running throughout her work we see a constant observation of the environment, a critique of society, the challenging of male and female gender roles and often autobiographical themes.',NULL,NULL,'GRAZ-sp'),('GRAZ-sp-tie','Tie','Self portrait','Ida Sofia Maly','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-sp/details/tie/image/tie.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/GRAZ-sp/details/tie/image/tie.jpg','The painter Ida Sofia Maly wrote a poem on the back of her drawing “Victory” in Vienna in May 1927. Today it is part of the Neue Galerie collection at the Universalmuseum Joanneum in Graz.\n\nIt reads:\nAs in a fairytale it began - - -\nOnce in the lovely summertime\nI am seized by profound anguish, \nDeep right into my heart.\nThe work did indeed bring me bread, \nBut then my artist’s heart despaired. \nTwo prizes were given to me,\nBut in my impetuosity\nI do not go to great trouble,\nAnd the pictures don’t turn out well. \nSo I took my satchel and hat -\nAnd then suddenly all was well. \nLove wanted to capture my heart - \nYet there came a miracle picture \nBecoming my shield of victory.\nNow I want to belong wholly to art.',NULL,NULL,'GRAZ-sp'),('MCA-ff','The artwork','Cycladic Female Figurine','Unknown','','','Marble Cycladic female figurine, 2300-2000 BC\n',NULL,NULL,NULL),('MCA-ff-body','Body','Cycladic Female Figurine','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-ff/details/body/image/body.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-ff/details/body/icon/body.jpg','90% of the figurines are female and most of them have anatomical features related to fertility.\nThe idea behind Cycladic figurines is that they represent the great Mother Goddess. This reflects the idea that the society of that time might have been matriarchal.',NULL,NULL,'MCA-ff'),('MCA-ff-head','Head','Cycladic Female Figurine','Unknown','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-ff/details/head/image/head.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-ff/details/head/icon/head.jpg','Marble was a material which was in abundance in the Cyclades area. The figurines which were constructed from 2800 to 2000 BC are all marble figurines. \nMarble figurines were decorated with colour in the face and body.\n',NULL,NULL,'MCA-ff'),('MCA-py','The artwork','Pyxis with lid','Pottery workshop in Attica','','','Pyxis with lid decorated with horses',NULL,NULL,NULL),('MCA-py-horses','Horses','Pyxis with lid','Pottery workshop in Attica','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-py/details/horses/image/horses.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-py/details/horses/icon/horses.jpg','The horses which decorate the lid of the pyxis are most probably connected with the owner of the Pyxis. He most probably belonged to the class of knights.',NULL,NULL,'MCA-py'),('MCA-wl','White Lekytos','White Lekytos','Attic Workshop','','','',NULL,NULL,NULL),('MCA-wl-body','Body','White Lekytos','Attic Workshop','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/body/icon/body.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/body/icon/body.jpg','The potter coated the surface of the vessel with a very fine slip of white clay (kaolin) as a base for the painter to design the iconography.\n',NULL,NULL,'MCA-wl'),('MCA-wl-bottom','Bottom','White Lekytos','Attic Workshop','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/bottom/image/bottom.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/bottom/icon/bottom.jpg','Today there are contemporary potters that continue to observe ancient techniques and incorporate them into their practice.\n',NULL,'https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/bottom/video/Making_a_white-ground_lekythos_of_430_BC.mp4','MCA-wl'),('MCA-wl-grip','Grip','White Lekytos','Attic Workshop','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/grip/image/grip.jpg','https://raw.githubusercontent.com/mbertini/reinherit-smartlens-assets/main/artworks/MCA-wl/details/grip/icon/grip.jpg','For the potter to construct the lekythos, he first moulded the vessel on the wheel. The grip was constructed separately and later attached to the vessel.\n',NULL,NULL,'MCA-wl');
